import Hero from '../components/Hero';
import NavBar from '../components/NavBar';
import ImageSrc from "../asserts/home.jpg"
import Destination from '../components/Destination';
import Trip from '../components/Trip';
import Footer from '../components/Footer';



import image1 from "../asserts/card1.jpg";
import image2 from "../asserts/card2.jpg";
import image3 from "../asserts/card3.jpg";




export default function Home(){
    return(
        <>
            <NavBar/>
            {/* <h1>This is Home</h1> */}
            <Hero 
                cName="hero" 
                src={ImageSrc}
                title = "Your Journey Your Story"
                text = "Choose Your Favourite Destination To Celebarte Your Love."
                href="/"
                btnClass="show"
                btnName="Travel Plan"
                />
            <Destination/>
            <Trip h={"Travel with your Partner as a Star"}                
               
            />
            <Footer/>
        </>
    );
}
